import background from "../images/backgroundmain.png";

export default function Main() {
    return (
        <div id="main">
            <div>
                <img src={background} alt="img" />
                <h1>ОТКРОЙТЕ ДЛЯ СЕБЯ МИР ВОЗМОЖНОСТЕЙ</h1>
            </div>
        </div>
    )
}
